import json


def get_pretty_json(data) -> str:
    """
    生成漂亮的json字符串
    :param data: 数据对象
    :return: str
    """
    ret = json.dumps(data, sort_keys=True, indent=4, separators=(', ', ': '), ensure_ascii=False)
    ret = ret.encode('utf-8').decode('unicode_escape')
    return ret


